    "2015-05-07T03:47:28.397063",nt"name": "aromatic-thermosetting-copolyester-composites-for-high-temperature-and-cryogenic-applicati",nt"isopen":
    true,nt"url": null,nt"notes": "Advanced composite materials processable
    by cost-effective manufacturing play an important role in developing lightweight
    structures for future exploratory missions. With growing demand for improved mission
    performance and reductions vehicle mass, advances in polymer systems with extreme
    thermo-mechanical properties are critical. rnThe primary objective of ATSP Innovations'
    Phase I work will be to fabricate and test low cost aromatic thermosetting copolyesters
    (ATSP): (1) for high performance composite structures for high temperature applications,
    (2) with high resistance to microcracking at cryogenic temperatures for use in next
    generation spacecraft missions. Our team partner, the University of Illinois at
    Urbana-Champaign (UIUC) will assist ATSP Innovations to perform advanced characterization
    and provide technical support for this project.  rnATSP Innovations and UIUC have
    developed ATSP for high performance composites that are stable at high temperatures
    and have an intrinsic resistance to microcracking. The liquid crystallinity of the
    polymer results in a local matching of CTE between fiber and matrix yielding minimal
    thermal residual stress in composites and higher fracture toughness than current
    resin systems. These capabilities allow the ATSP to address a wide range of current
    and future applications (at both cryogenic and high temperature regimes) critical
    to future NASA missions. rnThe synthetic development of ATSP was a major innovation
    in the field of polymer science. ATSP shows excellent performance as adhesives,
    flame resistant foams, and tribological wear coatings. ATSP resins possess the unique
    attribute among high temperature thermosets of solid-state bonding in a fully cured
    state to produce chemically contiguous specimens by Interchain Transesterification
    Reaction (ITR). This may open new modes of fabrication with relevance to NASA missions
    and the wider aerospace industry.",nt"license_title": "U.S. Government Work",nt"extras":
